css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("beta.chesstempo.com") {
.ct-board-style-blue-gradient .ct-square-dark {
    background: rgba(60, 37, 21, 0.5);
}

.ct-board-style-blue-gradient .ct-square-light {
    background: rgba(250, 220, 155, 0.5);
}

.ct-board-style-blue-gradient .ct-board-squares .ct-to-square {
    background: rgba(203, 163, 56, 0.5);
}

.ct-board-style-blue-gradient .ct-board-squares .ct-from-square {
    background: rgba(161, 128, 47, 0.5);
}

.ct-board-style-blue-gradient .ct-board-holder, .ct-coord-column, .ct-coord-row {
    background: #503020;
}

.ct-board-squares {
    /* https://pixabay.com/en/wood-structure-fund-nature-grain-186304/ CC0 */
    background: url(data:image/jpg;base64,);
}

}
